function centerWindow(n){n.sender.center()}function ShowAllPanels(n){for(var t=0;t<allElements.length;t++)$(allElements[t]).closest("[id^='"+n+"']").show}function HideAllPanels(n){for(var t=0;t<allElements.length;t++)$(allElements[t]).closest("[id^='"+n+"']").hide()}function ShowPages(n){var i,t;for(HideAllPanels(n),i=allElements.slice(currPage*20,20+currPage*20),t=0;t<i.length;t++)$(i[t]).closest("[id^='"+n+"]").show();$(".pageOf").html("Sida "+(currPage+1)+"/"+numberOfPages)}function NextPage(n){currPage!==numberOfPages-1&&(currPage++,ShowPages(n))}function PreviousPage(n){currPage!==0&&(currPage--,ShowPages(n))}function saveQuestionCallback(n){n.Error===undefined?toastr.success("Tillägg har sparats"):toastr.warning("Tillägg kunde inte sparas")}function openPopup(n,t){$("#schedule_"+n).dialog({title:t,height:"auto",modal:!0})}function clearToastr(){toastr.remove()}var Pager=function(n,t){this.selector=n;this.allElements=$(n);this.pageSize=t;this.currPage=0;this.numberOfPages=Math.ceil(this.allElements.length/t);var i=this,r=function(){$(i.selector).hide()};this.ShowPage=function(){r();var n=i.currPage*i.pageSize,t=n+i.pageSize,u=i.allElements.slice(n,t);$(u).show()};this.PreviousPage=function(){i.currPage!==0&&(i.currPage--,i.ShowPage())};this.NextPage=function(){i.currPage!==i.numberOfPages-1&&(i.currPage++,i.ShowPage())}};